import React from "react"
import "../../assets/"
function DownloadBtn() {
  const handleDownload = () => {
    const url = "./"
    window.open(url, "_blank")
  }

  return (
    <button className="download-btn" onClick={handleDownload}>
      Download CV
    </button>
  )
}

export default DownloadBtn
